class ActivityTab extends React.Component {
    render() {
        return (
            <span><b>{this.props.name}</b>gh {this.props.activity}</span>
        );
    }
}

export default class Activity extends React.Component {
    render() {
        return (
            <div>
                <ActivityTab name="user1" activity="commented on your post" />
                <ActivityTab name="user2" activity="liked your post" />
            </div>
        );
    }
}
